function App() {
  return (
    <div className='h-screen w-screen'>
      <header>
        <div className='h-[64px] sticky top-0 z-20 w-full border-b'>
          <div className='max-w-7xl mx-auto'>
            <div className='p-4 flex items-center'>
              <h1>HEADER</h1>
            </div>
          </div>
        </div>
      </header>
      <body>
          <div>
            hey
          </div>
      </body>
    </div>
  );
}

export default App;
